import { useState } from "react";
import { IconButton } from "@mui/material";
import Liked from "../Liked";
import styles from "./styles.module.scss";
import { MoreHoriz } from "@mui/icons-material";

const Clothes = ({closets, clothes}) => {
    const [menu, setMenu] = useState(false);

    return(
        <div className={styles.clothes_container}>
            <div className={styles.left}>
                <img src={clothes.img} alt="clothes" />
                <p>{clothes.category}</p>
                <p>{clothes.color}</p>
                <p>{clothes.brand}</p>
                <p>{clothes.season}</p>
            </div>
            <div className={styles.right}>
                <Liked clothId={clothes._id} />
                <IconButton className={styles.menu_btn} onClick={() => setMenu(true)}>
                    <MoreHoriz />
                </IconButton>

            </div>
        </div>
    );
};

export default Clothes;
